import React from "react";
import Modal from "../Modal";

const StreamDelete = () => {
	return (
		<div>
			StreamDelete
			<Modal
				title="Delete Stream"
				check="Are you sure you want to delete this stream?"
				delete="Delete"
				cancel="Cancel"
			/>
		</div>
	);
};

export default StreamDelete;
